<div class="explanation">
<h1>The "Popup-City"</h1>

    <div class="text_columns">
<p>This is something that I had in mind for a while now, but I didn't get the opportunity to try it out until recently. The benefit of doing an animation like this is that
no <em>Flash</em> or other Adobe software is required, which means that I don't have to shell
out tons of money to make it, and browsers that don't support Flash (I'm lookin' at you, iPad) will be able
to view Flash-like animations in pure JavaScript. The downside is that Safari and older browsers
don't render JavaScript animations all that well. In fact, they probably won't render the animation
on this page at
all. Fortunately Chrome, Opera, and the upcoming Firefox4 and IE9 <strong>do</strong> render these types of
animations. I'm still hoping that iOS-4.? will upgrade its performance, but that might just be
wishful thinking.</p>
<p>The main thing going on in this animation is a technique called "path-tweening", which is basically transforming
one SVG path (each building and shadow) into another. Here, there are 16 simultaneous path-tweening events going on.
If you look at the page source, you'll see what your browser has to contend with. In any case, the effect
is pretty cool, when it renders properly. **Reload the page to view the animation again!**</p>
